        <figure class=""stand_out"">

            <h3 class=""medium_heading""> II. OBJECTIFS PEDAGOGIQUES </h3>

            <div class=""sub_stand_out"">
                <h3 class=""small_heading""> II. 1. Origine du programme </h3>
                <p class=""description""> 
                    La chaîne logistique prend en charge l'ensemble de la gestion des flux de matières ou marchandises. 
                    Pour ce faire, elle gère directement les activités concernées, ceci en vue de maîtriser ou piloter :
                </p>
                <ul class=""one_list"">
                    <li> les flux et stocks de produits finis, en cours, semi-finis, matières premières concernées, etc. ; </li>
                    <li> mais aussi les ressources humaines internes ou prestataires externes telles fournisseurs, entreposage, magasinage, transport, tra");
            WriteLiteral(@"nsitaires, etc. </li>
                    <li> les équipements nécessaires à la réalisation de la prestation logistique (entrepôts, outillages, machines, manutention, véhicules propres, etc.), </li>
                    <li> les fournitures (emballage, consommables, sources d'énergie et carburants, etc.), </li>
                    <li> les services (planification, magasinage, emballage, manutention, transport, export, douane, facturation, litiges, etc.), </li>
                    <li> les systèmes d'information et de contrôle de gestion. </li>
                </ul>
                <p class=""description""> 
                    Le programme de Transport logistique dispensé par Business Intelligence Institute prend appuis sur les enseignements de spécialité en
                    exploitation logistique et transport pour outiller les étudiants à la gestion de la chaine logistique.
                </p>    
            </div>

            <div class=""sub_stand_out"">
                <h3 class=""small_head");
            WriteLiteral(@"ing""> II. 2. Objectifs du programme </h3>
                <h3 class=""smaller_heading""> II.2.1. Objectif général </h3>
                <p class=""description""> 
                    L’objectif de ce programme est de former des diplômés polyvalents dans les métiers du management et de la gestion de stock ou de magasin des
                    entreprises et ayant en particulier de solides connaissances en exploitation de la logistique et du transport. À la fin de ce programme, les diplômés
                    seront en mesure de mettre à profit les compétences acquises dans différentes minières et aussi dans les sociétés privés comme publics. 	
                </p>

                <h3 class=""smaller_heading""> II.2.2. Objectifs spécifiques </h3>
                <p class=""description""> 
                    <strong> Commun à la mention </strong><br/>
                    L’apprenant, à l’issue de ce programme sera capable de : <br/>
                </p>
                <ul class=""one_list"">
            ");
            WriteLiteral(@"        <li> Accompagner l'entreprise dans la maîtrise de ses enjeux d’exploitation logistiques ; </li>
                    <li> Assurer le suivi régulier de la gestion des stocks dans les différents chantiers ou missions spécifiques ; </li>
                    <li> Elaborer des budgets prévisionnels en matières logistique ; </li>
                    <li> Elaborer des budgets prévisionnels en matières logistique ; </li>
                    <li> Contrôler la gestion des transports ; </li>
                    <li> Contrôler, vérifier, inspecter, surveiller de manière critique les sorties et les entrées du matériel des entreprises ; </li>
                </ul>

                <h3 class=""small_heading""> II.3. Approche du programme </h3>
                <p class=""description""> 
